void model_init(){
    conv_layer0 = init_conv_layer0(); // Capa convolucional 1
    conv_layer1 = init_conv_layer1(); // Capa convolucional 2
    dense_layer0 = init_dense_layer0(); //Capa densa 1
}



int model_predict(data_t input, flatten_data_t * results){
    data_t output;
    flatten_data_t f_input;

    // Input
    #if PRINT_RESULTS==1
        Serial.println("Datos de entrada: ");
        print_data_t(input);
    #endif
  
  // Capa 1: Conv 2D
    conv2d_layer(conv_layer0,input,&output);    // Aplicar la convolución  de la capa
    #if PRINT_RESULTS == 1
        Serial.println("Matriz output capa 1 (Conv 2D): ");
        print_data_t(output);
    #endif
    relu(output);                           // Activación Capa ?: relu
    #if PRINT_RESULTS == 1
        Serial.println("Activacion capa 1 (Relu): ");
        print_data_t(output);
    #endif
  //free(input.data);
  input=output;
  
  // Capa 2: MaxPooling2D
  max_pooling_2d(2,input,&output);
    #if PRINT_RESULTS == 1
      Serial.println("Matriz output capa 2 (MaxPooling 2D): ");
      print_data_t(output);
    #endif
  //free(input.data);
  input=output;
  
  // Capa 3: Conv 2D
    conv2d_layer(conv_layer1,input,&output);    // Aplicar la convolución  de la capa
    #if PRINT_RESULTS == 1
        Serial.println("Matriz output capa 3 (Conv 2D): ");
        print_data_t(output);
    #endif
    relu(output);                           // Activación Capa ?: relu
    #if PRINT_RESULTS == 1
        Serial.println("Activacion capa 3 (Relu): ");
        print_data_t(output);
    #endif
  //free(input.data);
  input=output;
  
  // Capa 4: MaxPooling2D
  max_pooling_2d(2,input,&output);
    #if PRINT_RESULTS == 1
      Serial.println("Matriz output capa 4 (MaxPooling 2D): ");
      print_data_t(output);
    #endif
  //free(input.data);
  input=output;
  
  // Capa 5: Flatten
    flatten_data_t f_output;
    flatten_layer(output, &f_output);
    #if PRINT_RESULTS == 1
        Serial.println("Vector output capa 5 (Flatten): ");
        print_flatten_data_t(f_output); 
    #endif
    //free(output.data);
    f_input=f_output;
  // Capa 6: Dense
    dense_forward(dense_layer0,f_input,&f_output);
    #if PRINT_RESULTS == 1
        Serial.println("Vector output capa 6 (Dense): ");
        print_flatten_data_t(f_output);
    #endif
    //free(f_input.data);
  
    //Activación Capa 6: softmax
    softmax(f_output);
    #if PRINT_RESULTS == 1
        Serial.println("Activacion capa 6 (Softmax): ");
        print_flatten_data_t(f_output);
    #endif
    
  int result= argmax(f_output);
  *results = f_output;
  return result;
}
  